Ultimate Predator

Nature Documentary hosted by Bray Poor, published by National Geographic in 2014 - English narration


Information
------------------------------

Ultimate Predators
In the natural world there's one rule: eat or be eaten meet the animals that fall firmly into the category of natural born predators. Whether hunting alone or in packs, using mind or muscle, these beasts are built for killing and woe betide any other creature that gets in their way.
A look at the lethal power and strange abilities of four of nature's most vicious hunters: vipers, crocodiles, bears and sharks.


1)  Jaws of Death 
When a wounded lion is forced to give up its regular prey, it soon learns that humans are an easier catch. Plus, a baboon takes a human baby.

2)  Killer Instincts 
Brazilian sharks, Siberian tigers and Florida alligators are just some of the animals which will attack humans under the right circumstances.

3)  Chimp Attack 
Take a closer look at the animals you thought you knew - some notorious hunters and others deceptively friendly - and what happens when they live up to their wild potential. And when humans fall prey, find out what makes these beasts lash out. Go inside the infamous attack that left a woman with devastating injuries to her face and limbs after she was mauled by a chimpanzee. And find out what could have triggered an elephant to attack and kill its trainer during a routine circus performance.

